function FileItem({ file }) {
  return (
    <div className="file-item">
      {file.type === 'folder' ? (
        <div className="folder">
          <span>üìÅ</span>
          <span>{file.name}</span>
        </div>
      ) : (
        <div className="file">
          <span>üìÑ</span>
          <span>{file.name}</span>
          <span>{file.size}</span>
          <span>{file.modified}</span>
        </div>
      )}
    </div>
  );
}

export default FileItem;
